sources.Button.js:
import React, { Component } from 'react';

class Button extends Component {
  constructor(props) {
    super(props);
  }  
    render() {
        const { value, onIncrement, onDecrement } = this.props;
        const ok = () => {
          return "good"
        };
        let start = {
          list: 'opis',
          type: 'List'
        };
        return (
          <div className="App">
            <select>
              <option></option>
              <option value={start.list}>{start.list}</option>
              <option value={ok()}>{ok()}</option>
              <option value={start.type}>{start.type}</option>
            </select>
            <input type="checkbox"/>
            <input type="checkbox"/>
            <input type="checkbox"/>
          </div>
        );
      }
}

export default Button;
